import { DefaultTheme } from "styled-components";

const theme: DefaultTheme = {
    bgColor: "#2f3640",
    textColor: "#f5f6fa",
    accentColor: "#44bd32",
};

const darkTheme: DefaultTheme = {
    bgColor: "#333",
    textColor: "#333",
    accentColor: "#44bd32",
    liColor: "#fff",
};

const lightTheme: DefaultTheme = {
    bgColor: "#fff",
    textColor: "#fff",
    accentColor: "#44bd32",
    liColor: "#333",
};

export { theme, darkTheme, lightTheme };
